class Solution:
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        n = len(s1)
        if n == 0 :
            return ''
        for i in range(len(s2)-n+1):
            tmp = s2[i:i+n]
            a1 = self.str_dict(tmp)
            a2 = self.str_dict(s1)
            if a1 == a2:
                return True
        return False
    def str_dict(self,s1):
        dicts = dict()
        for key in s1:
            if key in dicts.keys():
                dicts[key]+=1
            else:
                dicts[key]=1
        return dicts
if __name__ == '__main__':
    solution = Solution()
    s1 = 'hello'
    s2 = 'ooooleh'
    s1=""
    s2=""
    result = solution.checkInclusion(s1,s2)
    print(result)